import React from 'react';

class Beranda extends React.Component {
    render() {
        return (
            <div>
                <h2>Selamat Datang Di Website Saya</h2>
                <p>
                    Selamat menjelajahi berbagai halaman yang tersedia melalui navigasi di atas.
                </p>
            </div>
        );
    }
}

export default Beranda;
